#include <stdio.h>
#include <string.h>
#include <stdlib.h>

void calcNext(int* next,int next_size,char* target)
{
    int k = 0;
    next[0] = 0;
    for (int i = 1; i < next_size; ++i)
    {
        while (k > 0 && target[k] != target[i]) k = next[k - 1];
        if (target[k] == target[i]) k++;
        next[i] = k;
    }
}

int KMP(char* src,char* target)
{
    int src_len = (int)strlen(src);
    int target_len = (int)strlen(target);
    if (!target_len) return 0;
    if (!src_len) return -1;
    if (target_len > src_len) return -1;
    int* next = (int*)calloc(target_len,sizeof(int));
    calcNext(next,target_len,target);
//    for (int i = 0; i < target_len; i++) printf("%d ",next[i]);
    for (int i = 0; i < src_len;)
    {
        int k = 0,i_bak = i;
        while (k < target_len && target[k] == src[i]) {++k;++i;}
        if (k == target_len) return i - k;
        i_bak += k == 0 ? 1 - next[k] : k - next[k - 1];
        i = i_bak;
        if (src_len - i < target_len) return -1;
    }
    return -1;
}

int main_KMP(void)
{
//    "ababcaababcaabc"
//    "ababcaabc"
    int res = KMP("","");
    printf("\n%d\n", res);
    return 0;
}
